import React from "react";
import { ReactComponent as SidebarBtn } from '../assets/sidebar_btn.svg';
import { ReactComponent as SearchIcon } from '../assets/search.svg';

const Navbar = () => {
    return (
        <>
            <nav className="navbar navbar-fixed-top navbar-dark bg-dark">
                <div class="container-fluid">
                    <button type="button" className="btn">
                        <SidebarBtn alt="logo" fill="white" width="32" height="32" />
                    </button>

                    <a className="navbar-brand mb-0 h1" href="../">E-Shop</a>

                    <form className="form-inline">
                        <div className="input-group">
                            <input className="form-control" type="search" placeholder="Search" aria-label="Search" />
                            <button className="btn" type="submit">
                                <SearchIcon alt="search" fill="white" width="32" height="32" />
                            </button>
                        </div>
                    </form>
                </div>
            </nav>
        </>
    )
}

export default Navbar;
